_elementor_data#C0F500990F2944FD8F32FC0A24B0F17E = "[{\"id\":\"1e289289\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"b553ba3\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"1bb54de1\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<!-- wp:fl-builder\\/layout -->\\n[smartslider3 slider=7]\\n\\t<h2><strong>P<\\/strong>rotect Your self and others around you now!<\\/h2>\\n<p>Coronavirus is transmitted between people, usually when someone is exposed to the secretions of the infected person. The transmission of the virus directly affects the transmission route. The current route of transmission of the new coronavirus is unclear, but past experience has shown that exposure to the body fluid that the infected person coughs or sprays, or shaking hands with the infected person lead to infection. If your hand touches something that the infected person has touched and then touches your own mouth, nose or eyes, it may also infect the virus.<\\/p>\\n<p>Normally, people have about a liter of fluid in their lungs, which, each time they sneeze, spray like a squeezed water bottle. In vitro, they are divided into more than 40,000 droplets, each containing a large number of viruses and bacteria. Because of the huge thrust in the body, the velocity of these liquids can be as high as 35 m \\/ s, and the propagation distance can reach 3~8 m. Come on, this picture is more intuitive.<\\/p>\\n<p>So be sure to wear a mask! Even if you are exposed to an infected person, wearing a mask can prevent you from inhaling the virus directly from the droplets.<\\/p>\\n<p>Wash your hands! Even if the virus is left in hand, hand washing can block the virus through the hand into the body.<\\/p>\\n<!-- \\/wp:fl-builder\\/layout -->\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"1e710e2\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\",\"animation\":\"slideInUp\"},\"elements\":[{\"id\":\